import React from "react";
import Sidebar from "./Sidebar";
import NavBar from "./NavBar"; // Importe o componente NavBar

const Home = () => {
  return (
    <div>
      <NavBar /> {/* Barra de navegação no topo */}
      <div style={{ display: 'flex' }}>
        <Sidebar />
        <div style={{ marginLeft: '260px', padding: '20px', marginTop: '60px' }}> {/* Espaço para a barra de navegação */}
          <h1>Bem-vindo ao Trinar!</h1>
          <p>Conteúdo da Home</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
